import { useEffect, useState } from "react"
import { useParams } from "react-router-dom"



function Details(){
   
const {empid}=useParams
const [det,setDet]=useState()

    useEffect(() => {
        fetch("http://localhost:3009/project/:"+empid)
            .then((res) => {
                return res.json()
            })
            .then((resp) => {
                console.log(resp)
                setDet(resp)
            })
    }, [])

    return(
        <div>
            <h1>Details</h1>
               {det &&
               <div>
                {det.id}
                {det.name}

               </div>
               }
        </div>
    )
}
export default Details;
